import React from 'react'
import { Link } from 'react-router-dom'

class NavBar extends React.Component{
    render(){
        return(
            <div className='NavBar'>
                <div className='logo'>
                    YourDollars
                </div>
                <div className='links'>
                    <ul>
                        <li><Link to='/SignUp'>Sign Up</Link></li>
                        <li><Link to='/LogIn'>Log In</Link></li>
                    </ul>
                </div>
            </div>
        )
    }
}

export default NavBar
